import React from 'react';
import '../../styles/Registration.css';
import AccountBox from '@material-ui/icons/AccountBox';
import {Button, FormControl, Input, InputAdornment, InputLabel} from "@material-ui/core";
import {makeStyles} from "@material-ui/core/styles";
import RegistrationService from '../../services/registration.service';
import getHostName from "../../services/host.service";
import LoginService from "../../services/login.service";
import history from "../../misc/history";

const useStyles = makeStyles((theme) => ({
    margin: {
        margin: theme.spacing(1),
    },
}));

function ProfileScreen() {

    const classes = useStyles();



    return(


        <div>

            { LoginService.isLoggedIn() ? (
                <div className="profilebox">
                    <br/>
                    <FormControl className={classes.margin}>
                        <InputLabel htmlFor="input-with-icon-adornment">With a start adornment</InputLabel>
                        <Input
                            id="input-with-icon-adornment"
                            startAdornment={
                                <InputAdornment position="start">
                                    <AccountBox/>
                                </InputAdornment>
                            }
                        />
                    </FormControl>
                </div>
            ) : (
                <>
                    <div className="center">
                        You are not logged in. If you already have account please
                    <a href="/login"><Button className="btn" onClick={() => history.push("/login")}>Log in</Button></a>
                    or if you don't fell free to
                        <a href="/registration"><Button className="btn" onClick={() => history.push("/registration")}>Register</Button></a>

                    </div>
                </>
            )}



        </div>
    );
}

export default ProfileScreen
